import React from "react";

import styles from './Card.module.css'

const App: React.FC = () => {
  return(
    <div className={styles.cardContainer}>
        <div>IMG</div>
        <div>Name</div>
        <div>Nickname</div>
        <div>Website</div>
        <button>More details</button>
    </div>
  )
}

export default App;
